#Running ASTRAL on the RAXML trees to find the species tree
cat *.tre > astralinput.tre
java -jar astral.5.7.5.jar -i astralinput.tre -o astraloutput.tre > astralout.log

#Running OrthoFinder
#All orthologs across D.coccinellae and all the i5k Hymenopterans are in the folder labeled hymenoptera_ortho

./orthofinder -f hymenoptera_ortho/

#Running MCMCtree - all required files are in the folder labeled mcmctree
#Use the mcmctree.ctl, tree1.tre files in the same folder, and run:
#tree1.tre was constructed by constraining root age < 1000 mya, using the JC69 model, and other fossil-calibrated times. See manuscript for details
#Also, amino acid alignments are in rand1.aa

mcmctree mcmctree.ctl

#MCMCtree Tracer File is available in mcmc_rand1_tracerfile.txt, and can be analyzed using Tracer

#Running Ancestral State Reconstruction - code to run Phytools is in anc_states.R; the time calibrated tree from MCMCtree had to be converted into an ultrametric tree first, and this can be accessed in hymtree_ultrametric.txt

#All character state distribution from across species analyzed is present in characters.txt file
#More details and comments on running ancestral state reconstruction in phytools are in anc_states.R
source("anc_states.R")



